import React, { useState, useEffect, useRef } from "react";
import "../custom_styles/chatBoxFull.css";
import image from "../components/image.png";
import colorImage from "../components/colorkit.png";
import loaderGif from "../public/images/827.gif";
import { stringify, v4 as uuidv4 } from "uuid";
import Cookies from "js-cookie";
import { TextareaAutosize } from "@mui/base/TextareaAutosize";
import { useLocation } from "react-router-dom";
import setting from "../images/setting.png";

function ChatBoxFull() {
  const [isOpen, setIsOpen] = useState(true); // Start with the chat box open
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState("");
  const [userMessage, setUserMessage] = useState("");
  const chatContainerRef = useRef(null);
  const [showChat, setShowChat] = useState(true); // Start with the chat box closed
  const inputRef = useRef(null);
  const [isTextEmpty, setIsTextEmpty] = useState(true);
  const [isLoading, setIsLoading] = useState(false); // Add isLoading state
  const [path, setPath] = useState("/");
  let SessionId = "";
  const maxRows = 4;
  const [audioSource, setAudioSource] = useState(null);
  const location = useLocation();
  const audioRefs = useRef([]);
  //const isChatPath = location.pathname === '/chat';

  useEffect(() => {
    // Access the pathname from the location
    const currentPath = location.pathname;
    console.log("Current route:", currentPath);
    setPath(currentPath);
    // Example: Redirect to a different route based on the current path
    if (currentPath === "/chat") {
      // Do something specific for the "/chat" route
    } else {
      // Do something specific for other routes
    }
  }, [location.pathname]);

  // console.log("here is path", path);
  useEffect(() => {
    if (userMessage) {
      setMessages([...messages, ...userMessage]);
    }
  }, [userMessage]);
  useEffect(() => {
    if (isOpen && messages.length === 0) {
      // When the chat is open and messages array is empty, add the welcome message
      setMessages([{ text: "Welcome to the chat!", user: "support" }]);
    }
  }, [isOpen, messages]);
  //Cookies code started here
  useEffect(() => {
    // Check if the cookie already exists
    let existingCookie = Cookies.get("SessionCookie");
    if (existingCookie) {
      SessionId = existingCookie;
    } else {
      const randomId = uuidv4();
      Cookies.set("SessionCookie", randomId, { expires: 30 });
      existingCookie = randomId;
    }
  }, []);
  const handleTextareaInput = (e) => {
    const textarea = e.target;
    const characterCount = textarea.value.length;

    const maxCharactersPerRow = 80; // Adjust this based on your design

    const rows = Math.ceil(characterCount / maxCharactersPerRow);

    if (rows > 4) {
      textarea.rows = 4; // Limit the number of visible rows to 4
      textarea.style.overflowY = "scroll"; // Enable vertical scrolling
    } else {
      textarea.rows = rows; // Expand the textarea based on character count
      textarea.style.overflowY = "hidden"; // Disable vertical scrolling
    }

    // Update the state with the new message
    setNewMessage(textarea.value);
  };

  // Cookies code ended here
  const handleSendMessage = async () => {
    console.log(messages);
    if (messages.length === 0) {
      setUserMessage([{ text: "Welcome to the chat!", user: "support" }]);
    }
    if (newMessage.trim() !== "") {
      setIsLoading(true);
      SessionId = Cookies.get("SessionCookie");
      // Add the user message to messages
      setMessages([...messages, { text: newMessage, user: "user" }]);
      const apiUrl = process.env.REACT_APP_CHAT_BOX_API_URL;
      const requestBody = {
        question: newMessage,
        CookiesId: SessionId,
      };
      setNewMessage("");
      // Make the API call using mockApiCall
      try {
        const response = await fetch(apiUrl, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(requestBody),
        });
        console.log(response)
        // if (response.ok) {
          //const responseData = await response.json();
          const responseData = await response.json();
          console.log(response.answer)
          if (responseData.answer) {
            // Check if the responseData contains audio
            const hasAudio = (responseData.audio)
            console.log(hasAudio)
              // && responseData.audio.base64) ||
              // (responseData.references &&
              //   responseData.references.some((file) => file.type === "audio"));

            // Construct a message that includes the answer with HTML content
            // ... (previous code)

            // ... (previous code)

            const isNewIncomingMessage = newMessage.trim() !== "";
            console.log("messagess : ", messages);

            // Create a ref to hold references to all audio elements

            const supportMessage = {
              text: (
                <div style={{}}>
                  <div
                    dangerouslySetInnerHTML={{ __html: responseData.answer }}
                  />
                  {hasAudio && responseData.audio && (
                    <>
                      <div style={{ marginTop: "10px" }} />{" "}
                      {/* Add space between text and audio */}
                      <audio
                        controls
                        ref={(audio) => {
                          // Add the reference to the array
                          audioRefs.current.push(audio);
                          if (
                            messages.length > 0 &&
                            messages[messages.length - 1].user === "support"
                          ) {
                            audio.play();
                            console.log(
                              "message audio : ",
                              messages.length - 1
                            );
                          }
                        }}
                      >
                        <source
                          src={`data:audio;base64,${responseData.audio}`}
                          type="audio/mp3"
                        />
                        Your browser does not support the audio element.
                      </audio>
                    </>
                  )}
                </div>
              ),
              user: "support",
            };

            // Pause all previous audio elements

            // Add the new support message to the array
            //setUserMessage((prevMessages) => [...prevMessages, supportMessage]);

            // ... (rest of the code)

            // Clear previous user messages and add the new message
            setUserMessage([supportMessage]);

            // Remove the previous audio source

            // ... (rest of the code)

            setUserMessage([supportMessage]);
          } else {
            // If there is no answer, just add the text response as a support message
            setUserMessage([{ text: responseData.answer, user: "support" }]);
          }
        // } else {
        //   console.error("Error Response:", response);
        //   setUserMessage([
        //     {
        //       text: "I encountered an error while processing your request.",
        //       user: "support",
        //     },
        //   ]);
        // }
      } catch (error) {
        console.error("Error parsing JSON:", error);
        setUserMessage([
          {
            text: "An error occurred while processing the response.",
            user: "support",
          },
        ]);
      } finally {
        setIsLoading(false);
      }
      // Clear the input field
      setNewMessage("");
    }
  };
  ///testing
  useEffect(() => {
    if (audioRefs.current.length > 1) {
      const lastAudio = audioRefs.current[audioRefs.current.length - 1];
      console.log("last audio", lastAudio);
      audioRefs.current.slice(0, -1).forEach((audio) => {
        audio.pause();
      });

      lastAudio.play();
    }
  });
  ///testing
  // Update the isTextEmpty state based on the text field value
  useEffect(() => {
    setIsTextEmpty(newMessage.trim() === "");
  }, [newMessage]);

  // Scroll to the bottom of the chat container whenever new messages are added
  useEffect(() => {
    if (chatContainerRef.current) {
      chatContainerRef.current.scrollTop =
        chatContainerRef.current.scrollHeight;
    }
  }, [messages]);

  return (
    <div className={`chat-container ${isOpen ? "open" : ""}`}>
      <div>
        {showChat && (
          <div className="chat-boxFull">
            {/* {console.log("inside the Fullchatbot", path)} */}
            <div className="chat-headerFull">
              {/* <div className="chat-titleFull">Ask me anything</div> */}
              <div
                className="chat-closeFull"
                onClick={() => setShowChat(!showChat)}
              >
                <img width="30" height="30" src={setting} alt="settings--v1" />
              </div>
            </div>
            <div style={{ height: "100%" }}>
              <div
                style={{
                  width: "100%",
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                <div className="chat-messagesFull" ref={chatContainerRef}>
                  {messages.map((message, index) => (
                    <div>
                      {message.user === "user" ? (
                        <div>
                          <p style={{ fontWeight: "600" }}>You</p>
                          <div key={index} className="user-messageFull">
                            {message.text}
                          </div>
                          <p style={{ fontWeight: "600" }}>Koenigsegg</p>
                        </div>
                      ) : (
                        <div key={index} className="support-messageFull">
                          {message.text}
                        </div>
                      )}

                      {/* <div
                        key={index}
                        className={`message ${
                          message.user === "user"
                            ? "user-message"
                            : "support-message"
                        }`}
                      >
                        {message.text}
                      </div> */}
                    </div>
                  ))}
                  {isLoading && (
                    <div className="message support-messageFull">
                      <img
                        src={loaderGif} // Replace with the path to your loading GIF
                        alt="Loading..."
                        className="loading-gif"
                      />
                    </div>
                  )}
                </div>
              </div>
              {isOpen && (
                <div
                  style={{
                    width: "100%",
                    display: "flex",
                    justifyContent: "center",
                  }}
                >
                  <div
                    className="chat-inputFull"
                    style={{
                      display: "flex",
                      alignItems: "center", // Align items in the center
                    }}
                  >
                    <TextareaAutosize
                      maxRows={4}
                      className="textAreaASFull"
                      aria-label="Demo input"
                      placeholder="Type your message..."
                      value={newMessage}
                      onChange={(e) => setNewMessage(e.target.value)}
                      onKeyDown={(e) => {
                        if (e.key === "Enter") {
                          e.preventDefault();
                          handleSendMessage();
                        }
                      }}
                      style={{
                        width: "100%", // Take up 100% width of the container
                        borderRadius: "8px",
                        border: "none",
                        outline: "none",
                        resize: "none",
                        maxHeight: "90px",
                        height: "60px",
                        overflowY: "auto",
                        padding: "5px 0", // Adjust the vertical padding
                      }}
                    />
                    {isTextEmpty ? (
                      <img
                        src={image}
                        alt="Send"
                        className="send-image"
                        style={{
                          height: "35px",
                          marginBottom: "15px",
                          marginLeft: "15px",
                          transform: "rotate(-25deg)",
                        }}
                      />
                    ) : (
                      <img
                        src={colorImage}
                        alt="Send"
                        className="send-image"
                        style={{
                          height: "35px",
                          marginBottom: "15px",
                          marginLeft: "15px",
                          transform: "rotate(-25deg)",
                        }}
                        onClick={handleSendMessage}
                      />
                    )}
                  </div>
                </div>
              )}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

